// src/components/Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = () => {
  const [maintenanceData, setMaintenanceData] = useState([]);
  
  useEffect(() => {
    const fetchMaintenanceData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/kfpl/test');
        console.log(response.data); // Check if data is received here
        setMaintenanceData(response.data);
      } catch (error) {
        console.error("Error fetching maintenance data:", error);
      }
    };
    

    fetchMaintenanceData();
  }, []);

  return (
    <div className="bg-white shadow-lg rounded-lg p-4">
      <h2 className="text-xl font-bold mb-4">Maintenance Dashboard</h2>
      <table className="min-w-full bg-white border border-gray-200">
        <thead>
          <tr>
            <th className="border px-4 py-2">Machine ID</th>
            <th className="border px-4 py-2">Model</th>
            <th className="border px-4 py-2">Next Maintenance Date</th>
            <th className="border px-4 py-2">Technician Name</th>
          </tr>
        </thead>
        <tbody>
          {maintenanceData.map((data) => (
            <tr key={data._id}>
              <td className="border px-4 py-2">{data.machine_id}</td>
              <td className="border px-4 py-2">{data.model}</td>
              <td className="border px-4 py-2">{data.next_maintenance_date}</td>
              <td className="border px-4 py-2">{data.technician_name}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
